const HomePage = () => {

    return (
        <div>
            <Button href='/' text='home' />
            <Button href='/timer' text='timer' />
            <style global jsx>{`
                body {
                    background-color: black;
                }
            `}</style>
        </div>
    )
}

export default HomePage
